import React, { useState } from 'react';
import axios from 'axios';

const Results = ({ payloads, fileInfo, onBack, onReset }) => {
  const [selectedPayload, setSelectedPayload] = useState(null);
  const [injecting, setInjecting] = useState(false);
  const [injectionResult, setInjectionResult] = useState(null);
  const [activeTab, setActiveTab] = useState('payloads');

  const handleInjectPayload = async (payload) => {
    setInjecting(true);
    try {
      // Create a FormData object for file upload
      const formData = new FormData();

      // Note: In a real implementation, you'd need to handle the actual file
      // For now, we'll simulate the injection process
      formData.append('payload_type', payload.type);
      formData.append('payload', payload.payload);
      formData.append('collaborator', 'https://test.burpcollaborator.net');

      // Simulate injection process
      await new Promise(resolve => setTimeout(resolve, 2000));

      const mockResult = {
        success: true,
        output_filename: `xxe_${Date.now()}_${fileInfo.name}`,
        modified_files: ['xl/workbook.xml', 'xl/sharedStrings.xml'],
        message: `Successfully injected XXE payload into 2 files`
      };

      setInjectionResult(mockResult);
      setActiveTab('results');
    } catch (error) {
      setInjectionResult({
        success: false,
        error: error.response?.data?.error || 'Failed to inject payload'
      });
    } finally {
      setInjecting(false);
    }
  };

  const copyToClipboard = (text) => {
    navigator.clipboard.writeText(text);
  };

  const getPayloadTypeColor = (type) => {
    const colors = {
      doctype: 'bg-blue-500',
      xinclude: 'bg-green-500',
      dtd: 'bg-yellow-500',
      svg: 'bg-purple-500'
    };
    return colors[type] || 'bg-gray-500';
  };

  const getPayloadTypeIcon = (type) => {
    switch (type) {
      case 'doctype':
        return (
          <svg className="w-4 h-4" fill="currentColor" viewBox="0 0 20 20">
            <path fillRule="evenodd" d="M4 4a2 2 0 012-2h4.586A2 2 0 0112 2.586L15.414 6A2 2 0 0116 7.414V16a2 2 0 01-2 2H6a2 2 0 01-2-2V4z" clipRule="evenodd" />
          </svg>
        );
      case 'xinclude':
        return (
          <svg className="w-4 h-4" fill="currentColor" viewBox="0 0 20 20">
            <path fillRule="evenodd" d="M3 4a1 1 0 011-1h12a1 1 0 110 2H4a1 1 0 01-1-1zm0 4a1 1 0 011-1h12a1 1 0 110 2H4a1 1 0 01-1-1zm0 4a1 1 0 011-1h12a1 1 0 110 2H4a1 1 0 01-1-1zm0 4a1 1 0 011-1h12a1 1 0 110 2H4a1 1 0 01-1-1z" clipRule="evenodd" />
          </svg>
        );
      default:
        return (
          <svg className="w-4 h-4" fill="currentColor" viewBox="0 0 20 20">
            <path fillRule="evenodd" d="M12.316 3.051a1 1 0 01.633 1.265l-4 12a1 1 0 11-1.898-.632l4-12a1 1 0 011.265-.633zM5.707 6.293a1 1 0 010 1.414L3.414 10l2.293 2.293a1 1 0 11-1.414 1.414l-3-3a1 1 0 010-1.414l3-3a1 1 0 011.414 0zm8.586 0a1 1 0 011.414 0l3 3a1 1 0 010 1.414l-3 3a1 1 0 11-1.414-1.414L16.586 10l-2.293-2.293a1 1 0 010-1.414z" clipRule="evenodd" />
          </svg>
        );
    }
  };

  return (
    <div className="bg-gray-800/50 backdrop-blur-sm rounded-xl p-8 border border-gray-700">
      <div className="flex items-center justify-between mb-6">
        <div className="flex items-center">
          <button
            onClick={onBack}
            className="mr-4 p-2 text-gray-400 hover:text-white transition-colors"
          >
            <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M15 19l-7-7 7-7" />
            </svg>
          </button>
          <div>
            <h2 className="text-2xl font-bold text-white">Generated Payloads</h2>
            <p className="text-gray-400">{payloads.length} payloads generated for {fileInfo?.name}</p>
          </div>
        </div>
        <button
          onClick={onReset}
          className="bg-gray-600 hover:bg-gray-700 text-white px-4 py-2 rounded-lg transition-colors"
        >
          Start Over
        </button>
      </div>

      {/* Tabs */}
      <div className="flex space-x-1 mb-6">
        <button
          onClick={() => setActiveTab('payloads')}
          className={`px-4 py-2 rounded-lg font-medium transition-colors ${
            activeTab === 'payloads'
              ? 'bg-blue-600 text-white'
              : 'bg-gray-700 text-gray-300 hover:bg-gray-600'
          }`}
        >
          Payloads ({payloads.length})
        </button>
        <button
          onClick={() => setActiveTab('results')}
          className={`px-4 py-2 rounded-lg font-medium transition-colors ${
            activeTab === 'results'
              ? 'bg-blue-600 text-white'
              : 'bg-gray-700 text-gray-300 hover:bg-gray-600'
          }`}
        >
          Injection Results
        </button>
      </div>

      {/* Payloads Tab */}
      {activeTab === 'payloads' && (
        <div className="space-y-4">
          {payloads.map((payload, index) => (
            <div key={index} className="bg-gray-700/30 rounded-lg border border-gray-600">
              <div className="p-4">
                <div className="flex items-center justify-between mb-3">
                  <div className="flex items-center">
                    <span className={`inline-flex items-center px-2 py-1 rounded-full text-xs font-medium text-white ${getPayloadTypeColor(payload.type)}`}>
                      {getPayloadTypeIcon(payload.type)}
                      <span className="ml-1">{payload.type.toUpperCase()}</span>
                    </span>
                    <h3 className="text-white font-medium ml-3">{payload.name}</h3>
                  </div>
                  <div className="flex space-x-2">
                    <button
                      onClick={() => copyToClipboard(payload.payload)}
                      className="text-gray-400 hover:text-white transition-colors"
                      title="Copy payload"
                    >
                      <svg className="w-5 h-5" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                        <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M8 16H6a2 2 0 01-2-2V6a2 2 0 012-2h8a2 2 0 012 2v2m-6 12h8a2 2 0 002-2v-8a2 2 0 00-2-2h-8a2 2 0 00-2 2v8a2 2 0 002 2z" />
                      </svg>
                    </button>
                    <button
                      onClick={() => setSelectedPayload(selectedPayload === index ? null : index)}
                      className="text-gray-400 hover:text-white transition-colors"
                    >
                      <svg className={`w-5 h-5 transform transition-transform ${selectedPayload === index ? 'rotate-180' : ''}`} fill="none" stroke="currentColor" viewBox="0 0 24 24">
                        <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M19 9l-7 7-7-7" />
                      </svg>
                    </button>
                  </div>
                </div>

                <p className="text-gray-400 text-sm mb-3">{payload.description}</p>

                {selectedPayload === index && (
                  <div className="mt-4">
                    <div className="bg-gray-900 rounded-lg p-4 mb-4">
                      <div className="flex items-center justify-between mb-2">
                        <span className="text-gray-400 text-sm font-medium">Payload Code</span>
                        <button
                          onClick={() => copyToClipboard(payload.payload)}
                          className="text-blue-400 hover:text-blue-300 text-sm"
                        >
                          Copy
                        </button>
                      </div>
                      <pre className="text-green-400 text-sm overflow-x-auto whitespace-pre-wrap">
                        {payload.payload}
                      </pre>
                    </div>

                    <button
                      onClick={() => handleInjectPayload(payload)}
                      disabled={injecting}
                      className="bg-gradient-to-r from-red-600 to-pink-600 hover:from-red-700 hover:to-pink-700 disabled:from-gray-600 disabled:to-gray-600 text-white font-medium py-2 px-4 rounded-lg transition-all duration-200 transform hover:scale-105 disabled:scale-100"
                    >
                      {injecting ? (
                        <div className="flex items-center">
                          <svg className="animate-spin -ml-1 mr-2 h-4 w-4 text-white" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24">
                            <circle className="opacity-25" cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="4"></circle>
                            <path className="opacity-75" fill="currentColor" d="M4 12a8 8 0 018-8V0C5.373 0 0 5.373 0 12h4zm2 5.291A7.962 7.962 0 014 12H0c0 3.042 1.135 5.824 3 7.938l3-2.647z"></path>
                          </svg>
                          Injecting...
                        </div>
                      ) : (
                        'Inject into File'
                      )}
                    </button>
                  </div>
                )}
              </div>
            </div>
          ))}
        </div>
      )}

      {/* Results Tab */}
      {activeTab === 'results' && (
        <div>
          {injectionResult ? (
            <div className={`rounded-lg p-6 ${injectionResult.success ? 'bg-green-900/20 border border-green-500/30' : 'bg-red-900/20 border border-red-500/30'}`}>
              <div className="flex items-center mb-4">
                {injectionResult.success ? (
                  <svg className="w-8 h-8 text-green-400 mr-3" fill="currentColor" viewBox="0 0 20 20">
                    <path fillRule="evenodd" d="M10 18a8 8 0 100-16 8 8 0 000 16zm3.707-9.293a1 1 0 00-1.414-1.414L9 10.586 7.707 9.293a1 1 0 00-1.414 1.414l2 2a1 1 0 001.414 0l4-4z" clipRule="evenodd" />
                  </svg>
                ) : (
                  <svg className="w-8 h-8 text-red-400 mr-3" fill="currentColor" viewBox="0 0 20 20">
                    <path fillRule="evenodd" d="M10 18a8 8 0 100-16 8 8 0 000 16zM8.707 7.293a1 1 0 00-1.414 1.414L8.586 10l-1.293 1.293a1 1 0 101.414 1.414L10 11.414l1.293 1.293a1 1 0 001.414-1.414L11.414 10l1.293-1.293a1 1 0 00-1.414-1.414L10 8.586 8.707 7.293z" clipRule="evenodd" />
                  </svg>
                )}
                <div>
                  <h3 className={`text-xl font-bold ${injectionResult.success ? 'text-green-300' : 'text-red-300'}`}>
                    {injectionResult.success ? 'Injection Successful' : 'Injection Failed'}
                  </h3>
                  <p className={`${injectionResult.success ? 'text-green-400' : 'text-red-400'}`}>
                    {injectionResult.message || injectionResult.error}
                  </p>
                </div>
              </div>

              {injectionResult.success && (
                <div className="space-y-4">
                  <div>
                    <h4 className="text-white font-medium mb-2">Output File</h4>
                    <div className="bg-gray-800 rounded-lg p-3 flex items-center justify-between">
                      <span className="text-gray-300">{injectionResult.output_filename}</span>
                      <button className="bg-blue-600 hover:bg-blue-700 text-white px-3 py-1 rounded text-sm transition-colors">
                        Download
                      </button>
                    </div>
                  </div>

                  <div>
                    <h4 className="text-white font-medium mb-2">Modified Files</h4>
                    <div className="space-y-2">
                      {injectionResult.modified_files?.map((file, index) => (
                        <div key={index} className="bg-gray-800 rounded-lg p-3">
                          <span className="text-gray-300">{file}</span>
                        </div>
                      ))}
                    </div>
                  </div>
                </div>
              )}
            </div>
          ) : (
            <div className="text-center py-12">
              <svg className="w-16 h-16 text-gray-500 mx-auto mb-4" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M9 12h6m-6 4h6m2 5H7a2 2 0 01-2-2V5a2 2 0 012-2h5.586a1 1 0 01.707.293l5.414 5.414a1 1 0 01.293.707V19a2 2 0 01-2 2z" />
              </svg>
              <h3 className="text-gray-400 text-lg font-medium mb-2">No Injection Results Yet</h3>
              <p className="text-gray-500">Select a payload and click "Inject into File" to see results here</p>
            </div>
          )}
        </div>
      )}
    </div>
  );
};

export default Results;
